import React from 'react'

export const GetTicketDetail = (props) => {
    let style={
        marginLeft: "auto",
        marginRight: "auto",
        marginBottom: "20px",
        width: "70%"
    }
    return (
        <>
            <div style={style} className="card text-center">
                <div className="card-header">{props.ticketDetail.bucket_name}</div>
                <div className="card-body">
                    <h5 className="card-title">{props.ticketDetail.bucket_name}</h5>
                    <p className="card-text">
                        {props.ticketDetail.description}
                    </p>
                    </div>
                <div className="card-footer text-muted">2 days ago</div>
            </div>
        </>
    )
}
